					moduleTexture.idLoadTexture++;
					moduleTexture.loadTexture();
				},

					setTimeout(moduleTexture.loadTexture, 200);
				}

				}else{
				
				}
			}
			
			//---------------------------------------------------------------------------------
			
			const LoadTextures =()=>{
				try{
					var mraidGetMaxSize = mraid.getMaxSize();
				}catch(e){}
				
				moduleTexture.load(CompleteLoadAllMaterials);
			}
						
			const CompleteLoadAllMaterials =()=>{
				//- InitPixi
				
				InitPixi();

				//- InitBasicObj
				
				InitBasicObj();
				
				//- Resize
				
				AppResize();
				
				window.addEventListener('resize', AppResize);
				
				//- Animation
				InitAnimation();
				
				//- EF
				StageEF();
				
			}
			const InitBasicObj = () =>{
	
				//- mcMain
				
				appMc.mcMain = new createContainer({p:stage, visible:false});					
					appMc.mcGame = new createContainer({p:appMc.mcMain});					
						
						appMc.mcWorldShake = new createContainer({p:appMc.mcGame});						
						appMc.mcWorldShake.shakeAX = 0;
						appMc.mcWorldShake.shakeAY = 0;
						appMc.mcWorldShake.shakeD = 0;
						
						//Back
							appMc.mcWorldCamera = new createContainer({p:appMc.mcWorldShake});	
								appMc.mcBg = new createSprite({p:appMc.mcWorldCamera,tex:"bg"});
								
						//Gradient						
							appMc.mcGradient = new createGradient({p:appMc.mcWorldCamera, points:[0,1], colors:["transparent", "rgba(0, 0, 0, 0.5)"], w:1280, h:1280});	
								
						//Tree 
							appMc.mcBgTree = new createSprite({p:appMc.mcWorldCamera,tex:"tree", y:-90, anchor:[0.5,0.9]});
							appMc.mcBgTree.a0 = RandomInteger(0,360);
							
						//Cow
							appMc.mcBgCow = new createSprite({p:appMc.mcWorldCamera,tex:"cow", y:220, anchor:[0.5,0.9]});
							appMc.mcBgCow.a0 = RandomInteger(0,360);
							
						
							
						//UI							
							appMc.mcUI = new createContainer({p:appMc.mcMain});	
							
							//Logo
								appMc.mcLogo = new createSprite({p:appMc.mcUI,tex:"logo", scale:0.4});
								
							//- mcBgOverlay						
								appMc.mcBgOverlay = new createRect({
									p:appMc.mcUI,
									x:-1280*0.5,
									y:-1280*0.5, 
									width:1280,
									height:1280,
									color:0x000000, 
									alpha:0.0,
									fill:1,
									radius:0
								});	
					
							
												
							appMc.mcDigit = new	createDigit({
									p:appMc.mcUI,
									tex: "digit",
									data: aDataDigit,
									num: 0, 
									spacing:0,
									x:0,
									y:0,
									aling:"left",
									separate:true,
									snum:3, 
									pref:"proc",	
									tint:0xffff00									
								});

						
						//- mcBgFS					
							appMc.mcBgFS = new createRect({
								p:appMc.mcUI,
								x:-1280*0.5,
								y:-1280*0.5, 
								width:1280,
								height:1280,
								color:0x121214, 
								alpha:0,
								visible:false
							});	

			
				appMc.mcWorldCamera.interactive = true;		
				appMc.mcWorldCamera.on('pointerdown', StageDown);	
				appMc.mcWorldCamera.on('pointermove', StageMove);
				appMc.mcWorldCamera.on('pointerup', StageUp);			
				appMc.mcBgFS.interactive = false;	
				appMc.mcBgFS.on('pointerup', ClickAd);
				
				//- mcBtnSound			
				appMc.mcBtnSound  = new createContainer({p:appMc.mcUI});			
					appMc.mcBtnSoundB = new createSprite({p:appMc.mcBtnSound,tex:"btn_sound_on"});

				appMc.mcBtnSound.interactive = true;				
				appMc.mcBtnSound.on('pointerup', BtnGlobalSound);
			}
			
			const InitAnimation = () =>{
				let i, objTemp;			
				appMc.mcMain.visible=true;			
				document.getElementById('main').style.visibility = "visible";
				document.getElementById('progress').style.display = "none";	
				appSounds["bg"].play();
				stateGame = 0;				
			}
			const EndGame = () =>{
				let i, objTemp;
				if(stateGame !=10){
					stateGame = 10;						
				}			
			}			
			const StageDown = (e) =>{			
				if(stateGame == 0){
					stateGame = 1;	
					if(!isGlobalActive){
						isGlobalActive = true;
						isGlobalSound = true;
						Howler.mute(!isGlobalSound);	
					}	
				}
				mouse.isDown = true;				
			}
			const StageMove = (e) =>{
				if(mouse.isDown){				
					mouse.x = e.data.getLocalPosition(appMc.mcWorldCamera).x;	
					mouse.y = e.data.getLocalPosition(appMc.mcWorldCamera).y;					
				}							
			}			
			const StageUp = (e) =>{
				mouse.isDown = false;					
			}
			const BtnGlobalSound =(e) =>{
				if(isGlobalSound){
					isGlobalSound = false;
					
					appMc.mcBtnSoundB.texture = moduleTexture.pixiTextures["btn_sound_off"];
					
					Howler.mute(true);
					
				}else{
					isGlobalSound = true;
				
					appMc.mcBtnSoundB.texture = moduleTexture.pixiTextures["btn_sound_on"];
					
					Howler.mute(false);
				}			
			}
			const StageEF = () => {				

				appObj.time_current = performance.now();				
				if(appObj.time_current - appObj.time_old > 25){
					appObj.time_old = appObj.time_current;
					// 33 - 30 fps
					// 16 - 60 fps
					
					let i,j,k;
					let objTemp;
					let objTempExtra;		
				
					gameScore +=3.001;
					appMc.mcDigit.update(gameScore);
					
				//Tree
					if(appMc.mcBgTree.visible){
						objTemp = appMc.mcBgTree;
						objTemp.a0 +=5;
						if(objTemp.a0 >=360)objTemp.a0 = -360;
						objTemp.skew.x = 0.05*Math.cos(objTemp.a0*toRAD);
					}
					
				//Cow					
					if(appMc.mcBgCow.visible){
						objTemp = appMc.mcBgCow;
						objTemp.a0 +=5;
						if(objTemp.a0 >=360)objTemp.a0 = -360;
						objTemp.scale.x = 1+0.015*Math.cos(objTemp.a0*toRAD);
						objTemp.scale.y = 1/objTemp.scale.x;
					}
									
				//- Camera
	
					if(appMc.mcWorldShake.shakeD != 0){
						appMc.mcWorldShake.shakeAX += 70;
						appMc.mcWorldShake.shakeAY += 90;
						if(appMc.mcWorldShake.shakeAX >= 360){ appMc.mcWorldShake.shakeAX -= 360; }
						if(appMc.mcWorldShake.shakeAY >= 360){ appMc.mcWorldShake.shakeAY -= 360; }						
						appMc.mcWorldShake.x = appMc.mcWorldShake.shakeD*Math.cos(appMc.mcWorldShake.shakeAX*toRAD);
						appMc.mcWorldShake.y = appMc.mcWorldShake.shakeD*Math.cos(appMc.mcWorldShake.shakeAY*toRAD);						
						appMc.mcWorldShake.shakeD *= 0.85;
						if(appMc.mcWorldShake.shakeD < 0.5){
							appMc.mcWorldShake.shakeD = 0;
							appMc.mcWorldShake.x = 0;
							appMc.mcWorldShake.y = 0;
						}			
					}
				
					tmDebug++
					if(tmDebug==100){					
						tmDebug = 0;						
					}					
								
					//- PIXI RENDER
					
					renderer.render(stage);
					
					//- RESIZE
					
					objTemp = appObj;					
					objTemp.tm_resize++;
					if(objTemp.tm_resize == 10){
						objTemp.tm_resize = 0;
						
						if(objTemp.mainWidth != Math.ceil(window.innerWidth) || objTemp.mainHeight != Math.ceil(window.innerHeight)){
							AppResize();							
						}
					}
				}
				
				//- RAF
				window.requestAnimationFrame(StageEF);
			}
			//---------------------------------------------------------------------------------
			//- Resize	

			const AppResize = (e) =>{
				appObj.mainWidth		= Math.ceil(window.innerWidth);
				appObj.mainHeight		= Math.ceil(window.innerHeight); 
				appObj.canvasWidth		= Math.ceil(1.4*window.innerWidth);
				appObj.canvasHeight		= Math.ceil(1.4*window.innerHeight); 
				
				renderer.view.style.width	= appObj.mainWidth+"px";
				renderer.view.style.height	= appObj.mainHeight+"px";							
				renderer.view.width			= appObj.canvasWidth;
				renderer.view.height		= appObj.canvasHeight;
				
				renderer.resize(appObj.canvasWidth, appObj.canvasHeight);
				
				stage.position.set(Math.ceil(appObj.canvasWidth*0.5), Math.ceil(appObj.canvasHeight*0.5));
								
						
				//- POSITION OBJ
				
				appMc.mcGame.scale.set(1, 1);	
				appMc.mcUI.scale.set(1, 1);	
				
				if(appObj.mainWidth<appObj.mainHeight){	
					appMc.mcGame.scale.x = appObj.canvasWidth/1280;
					appMc.mcGame.scale.y = appMc.mcGame.scale.x;
					if(appMc.mcGame.scale.y*1280 < appObj.canvasHeight){
						appMc.mcGame.scale.y = appObj.canvasHeight/1280;
						appMc.mcGame.scale.x = appMc.mcGame.scale.y;
					}
					
					appMc.mcUI.scale.x = appObj.canvasWidth/720;
					appMc.mcUI.scale.y = appMc.mcUI.scale.x;
					if(appMc.mcUI.scale.y*1280 > appObj.canvasHeight){
						appMc.mcUI.scale.y = appObj.canvasHeight/1280;
						appMc.mcUI.scale.x = appMc.mcUI.scale.y;
					}
					
										
					appMc.mcBgFS.scale.x = 0.1 + appObj.canvasWidth/1280/appMc.mcUI.scale.x;
					appMc.mcBgFS.scale.y = 0.1 + appObj.canvasHeight/1280/appMc.mcUI.scale.x;
					
					appMc.mcBgOverlay.scale.x = 0.1 + appObj.canvasWidth/1280/appMc.mcUI.scale.x;
					appMc.mcBgOverlay.scale.y = 0.1 + appObj.canvasHeight/1280/appMc.mcUI.scale.x;
					
					appMc.mcBtnSound.x = -60+appObj.canvasWidth*0.5/appMc.mcUI.scale.y;
					appMc.mcBtnSound.y = -70+appObj.canvasHeight*0.5/appMc.mcUI.scale.y;
					appMc.mcBtnSound.scale.set(0.65);
					
					appMc.mcLogo.x = 130-appObj.canvasWidth*0.5/appMc.mcUI.scale.y;
					appMc.mcLogo.y = 130-appObj.canvasHeight*0.5/appMc.mcUI.scale.y;
					
								
										
				}else{
					
					appMc.mcGame.scale.x = appObj.canvasWidth/1280;
					appMc.mcGame.scale.y = appMc.mcGame.scale.x;

						appMc.mcGame.scale.x = appMc.mcGame.scale.y;
					}
					
					appMc.mcUI.scale.x = appObj.canvasWidth/1280;
					appMc.mcUI.scale.y = appMc.mcUI.scale.x;	
					if(appMc.mcUI.scale.y*720 > appObj.canvasHeight){
						appMc.mcUI.scale.y = appObj.canvasHeight/720;
						appMc.mcUI.scale.x = appMc.mcUI.scale.y;
					}
															
					appMc.mcBgFS.scale.x = 0.1 + appObj.canvasWidth/1280/appMc.mcUI.scale.x;
					appMc.mcBgFS.scale.y = 0.1 + appObj.canvasHeight/1280/appMc.mcUI.scale.x;
					
					appMc.mcBgOverlay.scale.x = 0.1 + appObj.canvasWidth/1280/appMc.mcUI.scale.x;
					appMc.mcBgOverlay.scale.y = 0.1 + appObj.canvasHeight/1280/appMc.mcUI.scale.x;
					
					appMc.mcBtnSound.x = -60+appObj.canvasWidth*0.5/appMc.mcUI.scale.y;
					appMc.mcBtnSound.y = -60+appObj.canvasHeight*0.5/appMc.mcUI.scale.y;
					appMc.mcBtnSound.scale.set(0.65);
					
					appMc.mcLogo.x = 130-appObj.canvasWidth*0.5/appMc.mcUI.scale.y;

				}
			}
